import React from 'react';
import './images/App.css'
import backgroundImagePC from './css/header-background.jpg';
import backgroundImageMobile from './css/header-background.jpg';
import Header from './components/header';
import About from './components/about';
import Footer from './components/footer';

const App = () => {

  const imageUrl = window.innerWidth >= 650 ? backgroundImagePC : backgroundImageMobile;

  return (
    <div className="App" style={{ backgroundImage: `url(${imageUrl})` }}>
      <div className="App-content">
      </div>
    </div>
  )
}

export default App;
